import { createSignal } from 'solid-js';
import { generate } from '@pdfme/generator';

const BLANK_PDF = "data:application/pdf;base64,";
const CEREMONY_PDF = "data:application/pdf;base64,";
  
function PdfmeGenerator() {
  const [template, setTemplate] = createSignal({
    basePdf: CEREMONY_PDF,
    schemas: [
      {
        Fullname: {
          label: 'Full name',
          type: 'text',
          position: { x: 68.28, y: 60.66 },
          width: 100,
          height: 10,
          fieldType: 'text',
          errormessage: 'Please enter your name',
          required: true,
          autofocus: true,
        },
        Email: {
          label: 'Email',
          type: 'text',
          position: { x: 52.4, y: 69.55 },
          width: 140,
          height: 10,
          fieldType: 'text',
          errormessage: 'Enter your full address',
          required: false,
        },
        Phone: {
          label: 'Telephone number',
          type: 'text',
          position: { x: 53.76, y: 80.54 },
          width: 100,
          height: 10,
          fieldType: 'tel',
          errormessage: 'Enter a UK phone number',
          autocomplete: 'tel',
          required: true,
        },
        Date: {
          label: 'Date of event',
          type: 'text',
          position: { x: 33.65, y: 104.63 },
          width: 100,
          height: 10,
          fieldType: 'date',
          required: true,
          placeholder: 'dd/mm/yyyy',
        },
      },
    ],
  });
  
  const defaultValues = { Fullname: '', Email: '', Phone: '', Date: '' }
  const [inputs, setInputs] = createSignal(defaultValues);

  async function generatePdf() {
    console.log(template());
    console.log(inputs());

    const pdf = await generate({
      template: template(),
      inputs: [inputs()],
    });

    const blob = new Blob([pdf.buffer], { type: 'application/pdf' });
    window.open(URL.createObjectURL(blob));

    setInputs(defaultValues); // Reset inputs to default state after pdf generated
  }

  return (
    <div>
      <Form 
        template={template()}
        inputs={inputs()}
        onInputsChange={(newInputs) => setInputs(newInputs)}
      />

      <dialog id="pdfDialog">
        <form>
          <p>Please generate your ceremony options as a pdf. Then email it to ....</p>
          <button formmethod="dialog" autofocus type="reset" onclick={generatePdf}>Generate PDF</button>
          <button onclick="this.closest('dialog').close('Cancel')">Cancel</button>
        </form>
      </dialog>
    </div>
  );
}

function Form(props) {
  return (
    <form>
      {Object.entries(props.template.schemas[0]).map(([property, config]) => (
        <label for={property}>
          {config.label}
          {!config.required && <span> (optional)</span>}:
          <input
            name={property}
            id={property}
            class="pagination-list"
            type={config.fieldType}
            title={config.errormessage}
            required={config.required}
            placeholder={config.placeholder}
            pattern={config.pattern}
            autocomplete={config.autocomplete}
            autofocus={config.autofocus}
            value={props.inputs[property]}
            onChange={(e) =>
              props.onInputsChange({
                ...props.inputs,
                [property]: e.target.value,
              })
            }
          />
        </label>
      ))}
      <button type="submit" onclick="pdfDialog.showModal()">Continue</button>
    </form>
  );
}

export default PdfmeGenerator;
